  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户id，如果为0则是注册时使用的',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '状态0为未用1为已经使用',
  `use_time` int(11) NOT NULL DEFAULT '0' COMMENT '使用时间',
  `add_time` int(11) NOT NULL COMMENT '生成时间',
  `remark` varchar(255) NOT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COMMENT='短信验证信息' AUTO_INCREMENT=780 ;

