INSERT INTO `tp_show_love` (`id`, `title`, `content`, `picture`, `create_time`) VALUES
(3, '日本近海7.4级地震引发海啸 车队有序撤离', '<p>&nbsp;&nbsp; 当地时间2016年11月22日，22日清晨5点59分左右，日本福岛县海域发生了推测震级为里氏7.4级的地震。日本气象厅已向福岛县发布了海啸警报。图为地震发生后，疏散的车队排成长队有序撤离。</p><p><img src="/ueditor/php/upload/image/20161122/1479787348423217.jpg" title="1479787348423217.jpg" alt="Cyzw-fxxwrwh4889122.jpg"/></p>', '2016-11-22/5833c35878aa2.jpg', 1479787355);
